const cppCodeCompleter = {
    getCompletions: function(editor, session, pos, prefix, callback) {
        const completions = [];
        allCppCode.forEach((code) => {
            completions.push({
                caption: code.name,
                value: code.value,
                score: code.score,
                meta: code.meta
            });
        });
        callback(null, completions);
    }
};

export default cppCodeCompleter;